Blockly compiler.

Make sure Blockly's forever is compiled as:

while (true) {
  // yada yada yada
  pause
}

Blockly compiler.

Compile exponentiation. (It's by default in the Blockly-provided blocks, so
let's compile it rather than redefine our own arithmetic block.)

C++ compiler.

Change the syntax for shims. It is now:

  {shim:name_of_the_cpp_function}
